import { Fragment } from "react"
import Button from "./FORM/Button.js"

export default function Todo ({item,index}) {
    return (
       <Fragment>
        <div className="todo-list">
                <li className="todo" key={item.id}>
                    {item}
                </li>
                <Button 
                    id="delete-button"
                    type="button"
                    onClick={index}
                >
                    Delete
                </Button>
                </div>
        </Fragment>
    )
}
